           ticklen : 5,
           tickfont : {
              family: 'Arial',

           },
        },

        margin : {

           l : 100,
           r : 150,
           t : 110
        },
        annotations : [
           {
              xref: 'paper',
              yref : 'paper',

              y : 1.05,

              font : {

                 size : 30,
                 color : 'rgb(37,37,37)'
              },

           },
           {
              xref: 'paper',
              yref : 'paper',
              x : 0.5,
              y : -0.1,
              xanchor : 'center',

              text : 'Iterations',
              showarrow : false,
              font : {
                 family: 'Arial',
                 size : 22,
                 color : 'rgb(150,150,150)'
              }
           }
        ]
      };
      for (var i = 0; i < xData.length; i++) {
        var result = {
        xref: 'paper',

        text : yData[i][0],
        xanchor : 'right',

           color : 'black'
        }
        };
        var result2 = {

           yanchor : 'middle',

              size : 16,
              color : 'black'
           },
           showarrow : false,
           clicktoshow  : 'onout'
        };
        layout.annotations.push(result, result2);
      }
      var config = {responsive: true,

      Plotly.newPlot('Fluid Pressure', data, layout, config);
